import React from 'react'
import MovieCard from '../../molecules/MovieCard/MovieCard'
import './MoviesList.css'
export default function MoviesList(props){
    return(
        <div className='movie-list-container'>
            <MovieCard 
            name={props.name}
            year={props.year}
        />
        </div>

    )
}
